import React from "react";
import './Home.css';

function Home() {
  return (
    <div className="main-container">
      <div className="logo-container">
        <img src="/Chatbot.png" alt="Chatbot" className="intro-image" />
        <span id="typing-animation" className="mediconnect-name">MEDICONNECT</span>
      </div>
      
      <section id="about">
        <h1>About Us</h1>
        <p>Welcome to our company. We specialize in providing top-notch services to our clients.</p>
        {/* Add more content about your company here */}
      </section>
      
      <section id="services">
        <h2>Our Services</h2>
        <div className="service-item">
          <h3>Service 1</h3>
          <p>Description of Service 1.</p>
        </div>
        <div className="service-item">
          <h3>Service 2</h3>
          <p>Description of Service 2.</p>
        </div>
        {/* Add more services as needed */}
      </section>
    </div>
  );
}

export default Home;
